import { slide as Menu } from "react-burger-menu";
import UserComponent from './Component/UserComponent'
import ChangePassword from './Component/ChangePassword'
import CourseList from './Component/CourseList'
import EditProfile from './Component/EditProfile'


import {BrowserRouter as Router, Route,Switch,Link} from 'react-router-dom'


class Sidebar extends React.Component{
    render(){
        return(
      

       <router>

     
      <Link className="menu-item" to="/Changepassword">
        Change Password
      </Link>

      <Link className="menu-item" to="/CourseList">
        Course List
      </Link>

      <Link className="menu-item" to="/CreateCourse">
        Create Course
      </Link>

      <Link className="menu-item" to="/EditProfile">
        Edit Profile
      </Link>


      <Switch>
                
               
                   
                    <Route exact path="/Changepassword">
                        <ChangePassword/>
                    </Route>
                    <Route exact path="/CourseList">
                        <CourseList/>
                    </Route>
                    <Route exact path="/CreateCourse">
                        <CourseList/>
                    </Route>
                    <Route exact path="/EditProfile">
                       <EditProfile/>
                    </Route>
                   
                </Switch>
      </router>
